import React, { useEffect, useState } from 'react';
// import Table from '../Teble';

import PrvnTable from '../../component2/PrvnTable';
import Table from '../Teble';
import { EditOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';
import translator from '../../Translator/translator';
import DeleteModal from '../../component2/DeleteModal';
import { geomanagementApi } from '../../service/api';

function Countries(props) {
    const [dataSource, setDataSource] = useState([])
    const [name, setName] = useState("u")
    useEffect(() => {
        const params = { name: name }
        geomanagementApi.get("/countries", { params: params }).then((res) => {
            setDataSource(res.data.data)
        })
    }, [])

    const columns = [{
        title: 'nameLocal',
        dataIndex: 'localName',
        key: '1',
    },
    {
        title: 'otherName',
        dataIndex: 'otherName',
        key: '2',
    },
    {
        title: 'enName',
        dataIndex: 'enName',
        key: '3',
    },
    {
        title: 'createTime',
        dataIndex: 'createTime',
        key: '4',
    },
    {
        title: translator('Action'),
        key: 'action',
        render: (text, record) => (
            <Link
                to={{
                    pathname: `/countries/${record.id}/edit`,
                    state: { id: record.id }
                }}
            >
                <EditOutlined />
            </Link>
        ),
    },
    {
        title: 'deleted',
        dataIndex: 'deleted',
        key: 'deleted',
        render: (text, record) => {
            return <>
                <DeleteModal record={record} type={props.type} />
            </>
        }
    },
    ]


    return (
        <div>
            <input />
            <PrvnTable
                dataSource={dataSource}
                columns={columns}
                pagination={false}
            >
            </PrvnTable>
            {/* <Table
                dataSource={dataSource}
                columns={columns}
                pagination={false}
            >
            </Table> */}

        </div>
    );
}

export default Countries;
